import React from "react";
import "./Rules.css";

// Manuellt importera bilder
import bild1 from "../assets/gallery/bild1.jpg";
import bild2 from "../assets/gallery/bild2.jpg";
import bild3 from "../assets/gallery/bild3.jpg";
import bild4 from "../assets/gallery/bild4.jpg";
import bild5 from "../assets/gallery/bild5.jpg";
import bild6 from "../assets/gallery/bild6.jpg";
import bild7 from "../assets/gallery/bild7.jpg";
import bild8 from "../assets/gallery/bild8.jpg";
import bild9 from "../assets/gallery/bild9.jpg";


const images = [bild1, bild2, bild3, bild4, bild5, bild6, bild7, bild8, bild9,];

function Gallery() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Galleri</h1>
      <div className="rules-container" style={{ display: "flex", flexWrap: "wrap", gap: "15px" }}>
        {images.map((img, index) => (
          <div key={index} style={{ flex: "1 0 30%", minWidth: "200px" }}>
            <img
              src={img}
              alt={`Galleri ${index + 1}`}
              style={{ width: "100%", height: "auto", borderRadius: "8px" }}
            />
          </div>
        ))}
      </div>
    </div>
  );
}

export default Gallery;
